import React, { Component } from 'react';


class Blog extends Component {
  render() {
    return (
      <div className="container mt-5">
      <div className="row">
        <div className="col-lg-12  mx-auto">
          <h1 className="heading">Istorija Piva</h1>
          <hr/>
           <div className='post-preview'>
             <h3 className='mb-3'>Drugačiji od cijele planete</h3>
             <p className='mb-3'>
             Imajući u vidu da je istorijat piva dug skoro deset hiljada godina informacija da se pivo u BiH proizvodi zvanično tek malo više od sto pedeset  godina je u najmanju ruku čudna. 
             </p> 
           </div>
        </div>
       </div> 
      </div> 
    );
  }
}

export default Blog;
